svg.script:
      var lEye = document.getElementById("Left_Eye");
      var rEye = document.getElementById("Right_Eye");

      document.onmousemove = function(){

        //Left Eye
        var x = ((event.clientX * 1) - lEye.getBoundingClientRect().x *1.5) / window.innerWidth + "%";
        var y = ((event.clientY * 0.6) - rEye.getBoundingClientRect().y * 1) / window.innerHeight + "%";

        lEye.style.left = x;
        lEye.style.top = y;
        lEye.style.transform = "translate("+x+","+y+")"

        //Right Eye
        var x2 = ((event.clientX * 1) - rEye.getBoundingClientRect().x *1.7) / window.innerWidth + "%";
        var y2 = ((event.clientY * 0.6) - rEye.getBoundingClientRect().y) / window.innerHeight + "%";

        //for(var i = 0; 2 > i; i++){
        rEye.style.left = x2;
        rEye.style.top = y2;
        rEye.style.transform = "translate("+x2+","+y2+")"
    }
